import{_ as e,c as a,o as r,d as t}from"./app.985fc83f.js";const f='{"title":"Manuel","description":"","frontmatter":{},"headers":[{"level":2,"title":"Elements mat\xE9riels","slug":"elements-materiels"},{"level":3,"title":"La puce ZED-F9P","slug":"la-puce-zed-f9p"},{"level":3,"title":"Les antennes GNSS","slug":"les-antennes-gnss"},{"level":3,"title":"Raspberry Pi Zero 2 W","slug":"raspberry-pi-zero-2-w"},{"level":3,"title":"Pisugar 2","slug":"pisugar-2"},{"level":3,"title":"LoRa","slug":"lora"},{"level":3,"title":"Co\xFBt","slug":"cout"}],"relativePath":"materiel.md"}',n={},s=t(`<h1 id="manuel" tabindex="-1">Manuel <a class="header-anchor" href="#manuel" aria-hidden="true">#</a></h1><h2 id="elements-materiels" tabindex="-1">Elements mat\xE9riels <a class="header-anchor" href="#elements-materiels" aria-hidden="true">#</a></h2><h3 id="la-puce-zed-f9p" tabindex="-1">La puce ZED-F9P <a class="header-anchor" href="#la-puce-zed-f9p" aria-hidden="true">#</a></h3><p>La puce ZED-F9P de marque ublox est une puce bi-fr\xE9quences (L1+L2) int\xE9grant le RTK permettant un positionnement centim\xE9trique.</p><p>Le manuel est accessible <a href="https://cdn.sparkfun.com/assets/learn_tutorials/8/5/6/ZED-F9P_Integration_Manual.pdf" target="_blank" rel="noopener noreferrer">en ligne</a>.</p><p>Notre choix s&#39;est arr\xEAt\xE9 sur le mod\xE8le <a href="https://store-drotek.com/891-1023-rtk-zed-f9p-gnss.html" target="_blank" rel="noopener noreferrer">DP0601 RTK ZED-F9P GNSS</a> de chez Drotek, une entreprise localis\xE9 en Haute-Garonne</p><h3 id="les-antennes-gnss" tabindex="-1">Les antennes GNSS <a class="header-anchor" href="#les-antennes-gnss" aria-hidden="true">#</a></h3><p>Drotek propose des antennes multi-fr\xE9quences. On a choisi d&#39;utiliser le mod\xE8le <a href="https://store-drotek.com/910-da-910-multiband-gnss-antenna.html" target="_blank" rel="noopener noreferrer">DA910 multi-band GNSS Antenna</a> pour la Base et le mod\xE8le <a href="https://store-drotek.com/925-da233.html" target="_blank" rel="noopener noreferrer">DA233 multi-band GNSS Antenna</a> pour la partie Rover.</p><h3 id="raspberry-pi-zero-2-w" tabindex="-1">Raspberry Pi Zero 2 W <a class="header-anchor" href="#raspberry-pi-zero-2-w" aria-hidden="true">#</a></h3><p>C&#39;est la deuxi\xE8me version du Rapberry Pi Zero avec des am\xE9liorations. Il est pr\xE9sent\xE9 comme 5 fois plus performant que le RpiZero.</p><p>Sortie en 2021, le Raspberry Pi Zero 2 W repose sur le m\xEAme processeur que le RaspberryPi3 et il embarque 512Mo de Ram. Il integre un module wifi en 2.4 Ghz et un module bluetooth 4.2.</p><p>Il sera produit jusqu&#39;en 2028.</p><h3 id="pisugar-2" tabindex="-1">Pisugar 2 <a class="header-anchor" href="#pisugar-2" aria-hidden="true">#</a></h3><p>Module batterie pens\xE9 pour le RpiZero. Capable de fournir jusqu&#39;\xE0 2.4A, ce module sied parfaitement au RpiZero2W et peut alimenter notre projet complet en moyenne pendant 2h30min.</p><p>Plusieurs int\xE9r\xEAts du Pi sugar2 :</p><pre><code>- il n&#39;occupe pas de port GPIO, et il est tr\xE8s compact

- il peut \xEAtre charg\xE9 en m\xEAme temps qu&#39;il alimente le RpiZero2W, il se charge tr\xE8s bien en solaire

- il a une page web d\xE9di\xE9 \xE0 la surveillance du niveau de la batterie

- il a un bouton qui permet de programmer jusqu&#39;\xE0 3 actions
</code></pre><h3 id="lora" tabindex="-1">LoRa <a class="header-anchor" href="#lora" aria-hidden="true">#</a></h3><p>La partie radio communication sera assur\xE9e par un module LoRa. En effet cette technologie permet des communication longue distance (plrs kms) et une consommation d&#39;\xE9nergie r\xE9duite.</p><p>Plusieurs tests sont actuellement faits sur les mod\xE8les : SX1268 LoRa HAT de chez Waveshare. Prochainement, on va tester le mod\xE8le E220-400T22D de chez Ebyte qui est presque 6 fois moins cher.</p><h3 id="cout" tabindex="-1">Co\xFBt <a class="header-anchor" href="#cout" aria-hidden="true">#</a></h3><p>Raspberry Pi Zero 2 W = 18.90 \u20AC en temps normal</p><p>DP0601 RTK ZED-F9P GNSS = 204 \u20AC</p><p>Pisugar 2 = 39.99 \u20AC</p><p>DA910 multi-band GNSS Antenna = 99.90 \u20AC</p><p>ou DA233 multi-band GNSS Antenna = 69.90 \u20AC</p><p>Module LoRa = 6 \u20AC ou 33 \u20AC si SX1268 433M LoRa HAT</p><p>Cables = 10 \u20AC</p><p>Total pour 1 module complet : 350 \u20AC ou 380 \u20AC selon l&#39;antenne.</p><p>!! Le co\xFBt n&#39;inclut pas les \xE9ventuels frais de livraison.</p>`,29),l=[s];function o(i,p,u,d,c,m){return r(),a("div",null,l)}var b=e(n,[["render",o]]);export{f as __pageData,b as default};
